import{_ as e,c as t,o as a,a as p}from"./app.4131afa2.js";var r="/assets/fiber.bccd17ad.png",c="/assets/fiber_process.885b255a.png";const m=JSON.parse('{"title":"Vue \u4E0E React \u6846\u67B6\u5BF9\u6BD4","description":"","frontmatter":{},"headers":[],"relativePath":"vue/vue3/index.md"}'),i={name:"vue/vue3/index.md"},o=p('<h1 id="vue-\u4E0E-react-\u6846\u67B6\u5BF9\u6BD4" tabindex="-1">Vue \u4E0E React \u6846\u67B6\u5BF9\u6BD4 <a class="header-anchor" href="#vue-\u4E0E-react-\u6846\u67B6\u5BF9\u6BD4" aria-hidden="true">#</a></h1><p>Vue \u548C React \u5728\u6570\u636E\u53D1\u751F\u53D8\u5316\u540E\uFF0C\u5728\u901A\u77E5\u9875\u9762\u66F4\u65B0\u7684\u65B9\u5F0F\u4E0A\u6709\u660E\u663E\u7684\u4E0D\u540C\uFF0C\u901A\u4FD7\u7684\u6765\u8BF4\uFF0C\u5C31\u662F\u5728 Vue \u6846\u67B6\u4E0B\uFF0C\u5982\u679C\u6570\u636E\u53D8\u4E86\uFF0C\u6846\u67B6\u4F1A\u4E3B\u52A8\u544A\u8BC9\u4F60\u4FEE\u6539\u4E86\u54EA\u4E9B\u6570\u636E\uFF1B\u800C React \u7684\u6570\u636E\u53D8\u5316\u540E\uFF0C\u6211\u4EEC\u53EA\u80FD\u901A\u8FC7\u65B0\u8001\u6570\u636E\u7684\u8BA1\u7B97 Diff \u6765\u5F97\u77E5\u6570\u636E\u7684\u53D8\u5316\u3002</p><p>\u8FD9\u4E24\u4E2A\u89E3\u51B3\u65B9\u6848\u90FD\u89E3\u51B3\u4E86\u6570\u636E\u53D8\u5316\u540E\uFF0C\u5982\u4F55\u901A\u77E5\u9875\u9762\u66F4\u65B0\u7684\u95EE\u9898\uFF0C\u4F46\u662F\u5B83\u4EEC\u90FD\u78B0\u5230\u4E86\u6027\u80FD\u74F6\u9888\uFF1A</p><ul><li>\u5BF9\u4E8E Vue \u6765\u8BF4\uFF0C\u5B83\u7684\u4E00\u4E2A\u6838\u5FC3\u662F \u201C\u54CD\u5E94\u5F0F\u201D\uFF0C\u4E5F\u5C31\u662F\u6570\u636E\u53D8\u5316\u540E\uFF0C\u4F1A\u4E3B\u52A8\u901A\u77E5\u3002\u54CD\u5E94\u5F0F\u6570\u636E\u65B0\u5EFA Watcher \u76D1\u542C\uFF0C\u672C\u8EAB\u6BD4\u8F83\u635F\u8017\u6027\u80FD\uFF0C\u9879\u76EE\u89C4\u6A21\u5927\u4E86\u4EE5\u540E\u6BCF\u4E2A\u6570\u636E\u90FD\u6709\u4E00\u4E2A watcher \u4F1A\u5F71\u54CD\u6027\u80FD\uFF1B</li><li>\u5BF9\u4E8E React \u7684\u865A\u62DF DOM \u7684 Diff \u8BA1\u7B97\u903B\u8F91\u6765\u8BF4\uFF0C\u5982\u679C\u865A\u62DF DOM \u6811\u8FC7\u4E8E\u5E9E\u5927\uFF0C\u4F7F\u5F97\u8BA1\u7B97\u65F6\u95F4\u5927\u4E8E 16.6 ms\uFF0C\u90A3\u4E48\u5C31\u53EF\u80FD\u9020\u6210\u5361\u987F\u3002</li></ul><p>\u4E3A\u4E86\u89E3\u51B3\u8FD9\u79CD\u6027\u80FD\u74F6\u9888\uFF0CVue \u548C React \u8D70\u4E86\u4E0D\u540C\u7684\u9053\u8DEF\u3002</p><p>React \u4E3A\u4E86\u7A81\u7834\u6027\u80FD\u74F6\u9888\uFF0C\u501F\u9274\u4E86\u64CD\u4F5C\u7CFB\u7EDF\u65F6\u95F4\u5206\u7247\u7684\u6982\u5FF5\uFF0C\u5F15\u5165 Fiber \u67B6\u6784\u3002\u901A\u4FD7\u6765\u8BF4\uFF0C\u5C31\u662F\u628A\u6574\u4E2A\u865A\u62DF DOM \u6811\u5FAE\u89C2\u5316\uFF0C\u53D8\u6210\u94FE\u8868\uFF0C\u7136\u540E\u6211\u4EEC\u5229\u7528\u6D4F\u89C8\u5668\u7684\u7A7A\u95F2\u65F6\u95F4\u8BA1\u7B97 Diff\u3002\u4E00\u65E6\u6D4F\u89C8\u5668\u6709\u9700\u6C42\uFF0C\u6211\u4EEC\u5C31\u53EF\u4EE5\u628A\u6CA1\u8BA1\u7B97\u5B8C\u7684\u4EFB\u52A1\u653E\u5728\u4E00\u65C1\uFF0C\u628A\u4E3B\u8FDB\u7A0B\u63A7\u5236\u6743\u8FD8\u7ED9\u6D4F\u89C8\u5668\uFF0C\u7B49\u5F85\u6D4F\u89C8\u5668\u4E0B\u6B21\u7A7A\u95F2\u3002</p><blockquote><p>\u5173\u4E8E\u66F4\u591A Fiber \u7684\u76F8\u5173\u5185\u5BB9\u53EF\u4EE5\u67E5\u770B\u8FD9\u7BC7\u6587\u7AE0 - <a href="https://www.yueluo.club/detail?articleId=614e625806388427e6578046" target="_blank" rel="noopener noreferrer">Fiber</a>\u3002</p></blockquote><p>\u8FD9\u79CD\u67B6\u6784\u867D\u7136\u6CA1\u6709\u51CF\u5C11\u8BA1\u7B97\u91CF\uFF0C\u4F46\u662F\u5DE7\u5999\u5730\u5229\u7528\u7A7A\u95F2\u5B9E\u73B0\u8BA1\u7B97\uFF0C\u89E3\u51B3\u4E86\u5361\u987F\u7684\u95EE\u9898\u3002</p><img src="'+r+'"><p>\u4E0A\u56FE\u4E2D\uFF0C\u5DE6\u4FA7\u662F\u4E00\u4E2A\u6811\u5F62\u7ED3\u6784\uFF0C\u6811\u5F62\u7ED3\u6784\u7684 Diff \u5F88\u96BE\u4E2D\u65AD\u3002\u53F3\u4FA7\u5C06\u6811\u5F62\u7ED3\u6784\u6539\u9020\u6210\u4E86\u94FE\u8868\uFF0C\u6309\u7167 <code>\u5B50\u5143\u7D20-\u5144\u5F1F\u5143\u7D20-\u7236\u5143\u7D20</code> \u7684\u903B\u8F91\u8FDB\u884C\u904D\u5386\uFF0C\u53EF\u4EE5\u505A\u5230\u968F\u65F6\u4E2D\u65AD\u548C\u6062\u590D Diff \u7684\u8BA1\u7B97\u8FC7\u7A0B\u3002</p><img src="'+c+'"><p>\u8FD9\u4E2A\u56FE\u4E2D\u4E24\u4E2A\u865A\u7EBF\u4E4B\u95F4\u662F\u6D4F\u89C8\u5668\u7684\u4E00\u5E27\uFF0C\u9AD8\u6027\u80FD\u7684\u52A8\u753B\u8981\u6C42\u662F 60 fps\uFF0C\u4E5F\u5C31\u662F 1 \u79D2\u8981\u6E32\u67D3 60 \u6B21\uFF0C\u6BCF\u4E00\u5E27\u7684\u65F6\u95F4\u5C31\u662F 16.6 \u6BEB\u79D2\uFF0C\u5728\u8FD9 16.6 \u6BEB\u79D2\u91CC\uFF0C\u6D4F\u89C8\u5668\u81EA\u5DF1\u7684\u6E32\u67D3\u66F4\u65B0\u4EFB\u52A1\u6267\u884C\u540E\uFF0C\u4F1A\u6709\u4E00\u90E8\u5206\u7A7A\u95F2\u65F6\u95F4\uFF0C\u8FD9\u6BB5\u65F6\u95F4\u6211\u4EEC\u53EF\u4EE5\u7528\u6765\u8BA1\u7B97 Diff\u3002</p><p>\u7B49\u5230\u4E0B\u4E00\u5E27\u4EFB\u52A1\u6267\u884C\uFF0C\u6211\u4EEC\u5C31\u628A\u63A7\u5236\u6743\u8FD8\u7ED9\u6D4F\u89C8\u5668\uFF0C\u8BA9\u5B83\u7EE7\u7EED\u53BB\u66F4\u65B0\u548C\u6E32\u67D3\uFF0C\u7B49\u5F85\u7A7A\u95F2\u65F6\u95F4\u518D\u7EE7\u7EED\u8BA1\u7B97\uFF0C\u8FD9\u6837\u5C31\u4E0D\u4F1A\u5BFC\u81F4\u5361\u987F\u3002</p><p>Vue 1 \u7684\u95EE\u9898\u7684\u95EE\u9898\u5728\u4E8E\u54CD\u5E94\u5F0F\u6570\u636E\u8FC7\u591A\uFF0C\u8FD9\u6837\u4F1A\u5E26\u6765\u5185\u5B58\u5360\u7528\u8FC7\u591A\u7684\u95EE\u9898\u3002\u6240\u4EE5 Vue 2 \u5F15\u5165\u865A\u62DF DOM \u6765\u89E3\u51B3\u54CD\u5E94\u5F0F\u6570\u636E\u8FC7\u591A\u7684\u95EE\u9898\u3002</p><p>\u8FD9\u4E2A\u89E3\u51B3\u65B9\u6848\u4F7F\u7528\u865A\u62DF DOM \u89E3\u51B3\u4E86\u54CD\u5E94\u5F0F\u6570\u636E\u8FC7\u591A\u7684\u5185\u5B58\u5360\u7528\u95EE\u9898\uFF0C\u5E76\u4E14\u89C4\u907F\u4E86 React \u4E2D\u865A\u62DF DOM \u7684\u95EE\u9898\uFF0C\u5E76\u901A\u8FC7\u865A\u62DF DOM \u7ED9 Vue \u5E26\u6765\u8DE8\u7AEF\u80FD\u529B\u3002</p><p>\u5BF9\u4E8E Vue 2 \u6765\u8BF4\uFF0C\u7EC4\u4EF6\u4E4B\u95F4\u7684\u53D8\u5316\uFF0C\u53EF\u4EE5\u901A\u8FC7\u54CD\u5E94\u5F0F\u6765\u901A\u77E5\u66F4\u65B0\u3002\u7EC4\u4EF6\u5185\u90E8\u7684\u6570\u636E\u53D8\u5316\uFF0C\u5219\u901A\u8FC7\u865A\u62DF DOM \u53BB\u66F4\u65B0\u9875\u9762\uFF0C\u8FD9\u6837\u5C31\u628A\u54CD\u5E94\u5F0F\u7684\u76D1\u542C\u5668\uFF0C\u63A7\u5236\u5728\u7EC4\u4EF6\u7EA7\u522B\uFF0C\u865A\u62DF DOM \u7684\u5927\u5C0F\uFF0C\u4E5F\u63A7\u5236\u5728\u7EC4\u4EF6\u5927\u5C0F\u3002</p><p>\u9664\u4E86\u54CD\u5E94\u5F0F\u548C\u865A\u62DF DOM \u8FD9\u4E2A\u7EF4\u5EA6\uFF0CVue \u548C React \u8FD8\u6709\u4E00\u4E9B\u7406\u5FF5\u548C\u8DEF\u7EBF\u7684\u4E0D\u540C\u3002</p><p>React \u4E2D\u7F16\u5199 JSX\uFF0CJSX \u90FD\u4F1A\u5728 Compiler \u90A3\u4E00\u5C42\uFF0C\u901A\u8FC7\u5DE5\u7A0B\u5316\u7F16\u8BD1\u6210 JS \u6765\u6267\u884C\uFF0C\u6240\u4EE5 React \u53EF\u4EE5\u62E5\u6709\u5168\u90E8 JS \u7684\u52A8\u6001\u6027\uFF0C\u8FD9\u4E5F\u5BFC\u81F4 React \u7684 API \u4E00\u76F4\u5F88\u5C11\uFF0C\u53EA\u6709 state\u3001hooks\u3001Component \u51E0\u4E2A\u6982\u5FF5\uFF0C\u4E3B\u8981\u90FD\u662F JavaScript \u672C\u8EAB\u7684\u8BED\u6CD5\u548C\u7279\u6027\u3002</p><p>Vue \u4E2D\u9ED8\u8BA4\u4F7F\u7528 template\uFF0C\u8BED\u6CD5\u662F\u9650\u5B9A\u6B7B\u7684\uFF0C\u4F8B\u5982 <code>v-if</code>\u3001<code>v-for</code> \u7B49\u3002\u6709\u4E86\u8FD9\u4E9B\u8BED\u6CD5\u9650\u5236\uFF0C\u6211\u4EEC\u53EF\u4EE5\u5728\u4E0A\u7EBF\u524D\u505A\u5F88\u591A\u4F18\u5316\u3002Vue 3 \u5728\u865A\u62DF DOM \u7684\u9759\u6001\u6807\u8BB0\u4E0A\u505A\u5230\u4E86\u6781\u81F4\uFF0C\u8BA9\u9759\u6001\u4EE3\u7801\u90E8\u5206\u76F4\u63A5\u8D8A\u8FC7\u865A\u62DF DOM \u8BA1\u7B97\uFF0C\u771F\u6B63\u505A\u5230\u6309\u9700\u66F4\u65B0\uFF0C\u63D0\u9AD8\u4E86\u6027\u80FD\u3002</p><p>\u5728\u6A21\u677F\u7684\u4E66\u5199\u4E0A\uFF0C\u9664\u4E86 Vue \u548C React \u4F7F\u7528\u7684 template \u548C JSX \u4E4B\u5916\uFF0C\u8FD8\u51FA\u73B0\u4E86 Svelte \u8FD9\u79CD\u6846\u67B6\uFF0C\u5B83\u4E0D\u5B58\u5728\u865A\u62DF DOM \u5E93\uFF0C\u76F4\u63A5\u5C06\u6A21\u677F\u7F16\u8BD1\u6210\u539F\u751F DOM\uFF0C\u51E0\u4E4E\u4E0D\u5B58\u5728 Runtime\uFF0C\u6240\u4EE5\u7684\u903B\u8F91\u90FD\u5728 Compiler \u5C42\u4F18\u5316\uFF0C\u7B97\u662F\u53E6\u4E00\u4E2A\u65B9\u5411\u7684\u6781\u81F4\u3002</p><p>\u8FD9\u91CC\u8FD8\u6709\u4E00\u4E2A\u95EE\u9898\uFF0C\u90A3\u5C31\u662F Vue \u4E3A\u4EC0\u4E48\u4E0D\u9700\u8981 React \u7684 Fiber\uFF1F</p><p>\u5176\u5B9E\u6700\u65E9 Vue 3 \u7684\u63D0\u6848\u4E2D\u4F7F\u5305\u542B\u65F6\u95F4\u5207\u7247\u65B9\u6848\u7684\uFF0C\u6700\u540E\u5E9F\u5F03\u7684\u4E3B\u8981\u539F\u56E0\uFF0C\u662F\u56E0\u4E3A\u4F7F\u7528\u65F6\u95F4\u5207\u7247\u89E3\u51B3\u7684\u95EE\u9898\uFF0CVue 3 \u5E76\u4E0D\u4F1A\u51FA\u73B0\uFF1A</p><ul><li>Vue 3 \u628A\u865A\u62DF DOM \u63A7\u5236\u5728\u7EC4\u4EF6\u7EA7\u522B\uFF0C\u7EC4\u4EF6\u4E4B\u95F4\u4F7F\u7528\u54CD\u5E94\u5F0F\uFF0C\u8FD9\u4F7F\u5F97 Vue 3 \u7684\u865A\u62DF DOM \u4E0D\u4F1A\u8FC7\u4E8E\u5E9E\u5927\uFF1B</li><li>Vue 3 \u865A\u62DF DOM \u7684\u9759\u6001\u6807\u8BB0\u548C\u81EA\u52A8\u7F13\u5B58\u529F\u80FD\uFF0C\u8BA9\u9759\u6001\u8282\u70B9\u548C\u5C5E\u6027\u53EF\u4EE5\u76F4\u63A5\u7ED5\u8FC7 Diff \u903B\u8F91\uFF0C\u51CF\u5C11\u4E86\u865A\u62DF DOM \u7684 Diff \u4E8B\u4EF6\uFF1B</li><li>\u5F15\u5165\u65F6\u95F4\u5207\u7247\u673A\u5236\u4F1A\u5E26\u6765\u989D\u5916\u7684\u7CFB\u7EDF\u590D\u6742\u6027\u3002</li></ul><p>\u53E6\u5916\u5173\u4E8E Vue \u7684\u65B0\u8BED\u6CD5\u548C\u65B0\u529F\u80FD\u8BA8\u8BBA\uFF0C\u90FD\u4F1A\u5728 GitHub \u4E0A\u516C\u5F00\u5F81\u6C42\u610F\u89C1\uFF0C\u9080\u8BF7\u793E\u533A\u6240\u6709\u7684\u4EBA\u4E00\u8D77\u8BA8\u8BBA\uFF0C\u4F60\u53EF\u4EE5\u968F\u65F6\u6253\u5F00\u8FD9\u4E2A<a href="https://github.com/vuejs/rfcs" target="_blank" rel="noopener noreferrer">\u9879\u76EE</a>\u3002</p><p>Vue 3 \u6B63\u5728\u8BA8\u8BBA\u4E2D\u7684\u65B0\u9700\u6C42\uFF0C\u4EFB\u4F55\u4EBA\u90FD\u53EF\u4EE5\u56F4\u89C2\u3001\u53C2\u4E0E\u8BA8\u8BBA\u548C\u5C1D\u8BD5\u5B9E\u73B0\u3002</p>',25),u=[o];function s(l,n,f,_,d,D){return a(),t("div",null,u)}var h=e(i,[["render",s]]);export{m as __pageData,h as default};
